><div class='tn-atom'field='tn_text_1663892177281'>Delphi safe bot is basically an early warning system. Anyone will be able to submit info they have about potential rugs/scams/hacks/drains via our discord or website. A team of people, from different time-zones will be reviewing these 24/7. Depending on the info provided, a threat level (yellow, orange, red) is determined and a warning is created and sent out via our discord bot to every connected server (owners can either create a separate channel for the bot, or connect it to their existing rug warning channel). Also the warning is posted on our website and via twitter bot. <br><br>We will ask all projects who collab with us pre-mint to commit to adding the Delphi safe bot to their server after we launch it. Also any person with good twitter reach will be able to obtain a WL/OG by commiting to tweet and tag our twitter bot account. This way we plan to have a big reach from the start. Afterwards we will continue to increase our reach by offering the bot to new projects, holding interesting events &amp; etc. <br><br>Our website will store the history of all warnings ever sent out. This is a cool feature, people who don't spend much time on discord or twitter, but decide to mint something for once, can just search the project on our site and see if any warnings regarding it ever popped up. Also people will be able to sign up to receive warnings directly in DM's via delphi subscriptions.</div> </div>
