><div class='tn-atom'field='tn_text_1663892177281'>Delphi safe browser extension will be the second product in our line that aims to up the safety in the NFT space. The goal of this extension is to protect users from drains and fishing websites.<br><br>Our extension will contain a data base of the most used websites in the NFT space. Each time you visit a legit website you will get a small notification in the corner of your screen. "You are on the real Magic Eden page". If you visit a fake website that is trying to impersonate one of the real sites from the data base, the extension will see that and warn you. There will also be a possibility to customize the data base, delete or add websites and basically create a personal list.</div> </div>
