><div class='tn-atom'field='tn_text_1663892177281'><span style="font-weight: 400;">Delphi options</span> is the next generation binary options prediction game, that will cover assets like BTC/ETH/SOL to start with.<br><br>What makes our game different from all the other prediction games on sol, is that you will be able to enter the market AT ANY MOMENT, and choose a time period of the trade yourself! If you guess correctly your sol get's multiplied by a pre-determined multiplier (f.e. x2 x1.9 etc).<br><br>What makes this different from all the other prediction games is that they have a fixed 5 min window in which you have to deposit sol and choose up or down, then you wait till this deposit window ends and only then the bet opens and lasts for 5 min. So you can't choose when and for how long to enter the market. This is decided for you. We solve this and make the game so much more interesting for the player.</div> </div>
