><div class='tn-atom'field='tn_text_1663892177281'>A public prediction can be created by any user. To start, an asset (crypto or large mcap NFT), time period and a price point is chosen. After that a window will open and users will be able to place up/down predictions for any amount of sol depending on wether the user thinks the chosen asset will cost more or less then the chosen price at the end of the chosen time period. After the prediction ends the winners share the losers money proportionally to their investments excluding the platform fee which is shared between the platform and the creator of the public prediction.<br><br>Example: Prediction - Degods, 1 week, 1000 sol. Tom bets 20 sol on down. Total bets are 80 down, 160 up. After the week ends Degods FP is at 800. This means that Tom won and the total prize pool is 240 sol. He put in 20/80 (25% of the winning bet) so he will receive (240 - 24 (platform fee))*0.25 = 54 sol or 34 sol pure profit. The 24 sol (10%) fee is split between the platform and the prediction creator.<br><br>If the creator is not an oracle holder he will receive 10% of the fee, if he is he will receive from 20% to 80% of the fee depending on how many oracles he holds. *10% is the fee for non-holders. Fee for Oracle holders will range from 5% to 8% depending on how many they hold. Let’s go back to the example above and imagine Tom holds some oracles. Then he will book a 57 (5% fee) sol win instead of a 54 (10% fee) sol win.</div> </div>
