><div class='tn-atom'field='tn_text_1663892177281'>Just like in public predictions, the initiator of the<br>PvP prediction chooses an asset (crypto or large mcap NFT), a time period and a price point. He then chooses his side of the bet (higher or lower) and enters his opponents wallet address. After that the process is similar to a FFF swap.<br><br>Users have to choose their wagers. This can be NFT’s, sol or both. After the prediction is finished the winner takes all. The platform will take a 2% fee on sol bets and 0.02 sol for each nft (for non-holders). Fees for Oracle holders will start at 1% on sol &amp; 0.01 on each nft and go down to just a fixed fee of 0.01 sol for any type of bet, depending on how many Oracles you hold.<br><br>Now we realise that the NFT market is not yet fully mature and can be manipulated. To prevent cheating, only liquid collections with high trading volumes will be opened for predictions. Apart from that after a trade ends, both parties will have a window of time in which they will be able to request a check-up by the team if they think their opponent cheated or manipulated the price in any way.</div> </div>
