><div class='tn-atom'field='tn_text_1663892177281'><strong>Delphi</strong> <s>ONLYFANS</s> <strong>subscriptions</strong> will use the infrastructure we build for delphi safe bot and open up a new way for creators, callers, analysts &amp; many others to monetize their knowledge and skills.<br><br>Let's say you are a crazy good alpha caller, you get payed X sol a week from a few DAO's, but you are worth way more. Then you go to our platform and create your own subscription. From that moment, any user will be able to subscribe and receive your calls directly to DM's.<br><br>Or let's say you are a sexy crypto twitter chick. FUCK only fans. Your audience doesn't have the time to leave discord, they are grinding WL's or researching projects. Let them receive your content directly to discord DM's and increase your income as well. (At first we wrote that as a joke, but who knows what people will come up with LMAO).<br><br>Apart from personal subscriptions, people will be able to add delphi bot to their servers and subscribe to receive content in one of the channels on their server, available to all the servers members. Of course the creator chooses wether to allow this or not, and can set a higher subscription price for a server subscription.<br><br>We plan to attract lot's of talented people to our platform and finance some subscriptions out of pocket (we will pay creators, and some of the subscriptions are gonna be free for all and some free only for oracle holders).<br><br>Our platform will also allow users to create custom baskets containing alpha, analysis, news &amp; entertainment subscriptions. It will also make life so much easier for project owners who will be able to form their dream alpha sections for holders in a few clicks, without having to worry about hiring &amp; etc.<br><br>We will take a 10% fee from the profits any subscription generates from creators if they are non holders. If the creator holds an oracle our fee will range from 8% to 4% depending on the amount he holds. This fee will be split between the team to pay staff working on the platform and between Oracle holders via our rev-share program.</div> </div>
